import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul>
          <li><a href="google.com">Home</a></li>
          <li><a href="facebook./com">My Patients</a></li>
          <li>Notifications</li>
          <li>Upload Content</li>
          <li>My Content</li>
          <li>My Profile</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
